#build
static function build($n){
	static $pi4; if(!$pi4)$pi4=1;
	static $i; $i+=2;
	static $o; $o=$o?0:1;
	$current=bcdiv(1,1+$i);
	if($o)$pi4=bcsub($pi4,$current); else $pi4=bcadd($pi4,$current);
	if($i<$n)return self::build($n); else return $pi4;}

