$pi4=self::build($n);
$ret=bcmul($pi4,4).br();*/

#call
static function call($p){
$n=$p['inp2']??40000;
bcscale(40);
$pi4=self::build($n);
$ret='from calc: '.bcmul($pi4,4).br();
$ret.='from php: '.pi().br();
$pi=self::result();
$ret.='from  '.lk('http://www.piday.org/million/').': '.span($pi,'code','','word-wrap:break-word').br();
return $ret;}

static function menu($p){
$j=self::$cb.'|'.self::$a.',call||inp2';
$bt=bj($j,langp('ok'),'btn').hlpbt('pi_app');
$v=$p['p1']??40000;
return inputcall($j,'inp2',$v,22,lang('iterations')).$bt;}

#content
static function content($p){
$p['p1']=$p['p1']??'';
$bt=self::menu($p);
$ret=self::call($p);
return $bt.div($ret,'pane',self::$cb);}//
